import { useState } from "react"
import "./TodoApp.css"
import {BrowserRouter,Routes,Route, useNavigate, useParams, Link} from 'react-router-dom'
export default function TodoApp(){
    return (
        <div className="TodoApp">
             
             {/* Todo Management Application */}
           <BrowserRouter>
           <HeaderComponent/>
                <Routes>
                    <Route path='/' element={<LoginComponent/>}/>
                    <Route path="/login" element={<LoginComponent/>}/>
                    <Route path="/welcome/:username" element={<WelcomeComponent/>}/>
                    <Route path="*" element={<ErrorComponent/>}></Route>
                    <Route path="/todos" element={<ListTodosComponent/>}></Route>
                    <Route path="/logout" element={<LogoutComponent/>}></Route>
                </Routes>
                <FooterComponent/>
            </BrowserRouter>
            
             {/* <LoginComponent/> */}
             {/* <WelcomeComponent/> */}
        </div>
    )
}

function LoginComponent(){
      const[username,setUsername] = useState('aditya')
      const [password,setPassword] = useState('')
      const [showSuccessMessage, setShowSuccessMessage] = useState(false)
      const [showErrorMessage, setShowErrorMessage] = useState(false)

      const navigate = useNavigate();

       function handleUsernameChange(event){
         setUsername(event.target.value)
       }
       function handlePasswordChange(event){
        setPassword(event.target.value)
       }
       function handleSubmit(){
        if(username==='aditya' && password ==='dummy'){
            setShowSuccessMessage(true)
            setShowErrorMessage(false)
            navigate(`/welcome/${username}`)
        }
        else{
            setShowSuccessMessage(false)
            setShowErrorMessage(true)
        //    navigate('')
        }
       }
       return (
        <div className="Login">
                <h1>time to login!</h1>
                {showSuccessMessage && <div className="successMessage">Authenticated Successful</div>}
                {showErrorMessage && <div className="errorMessage">Authenticated Failed</div>}

                <div className="LoginForm">
                <label>Username :</label>
                <input type="text" name="username" value={username} onChange={handleUsernameChange}/>
                <label>Password :</label>
                <input type="text" name="password" value={password} onChange={handlePasswordChange}/>
            </div>
            <div>
                <button type="button" name="login" onClick={handleSubmit}>login</button>
            </div>
        </div>
       )
}

function WelcomeComponent(){
    const {username} = useParams()
    console.log(username)
    return (
        <div className="WelcomeComponent">
            <h1>Welcome {username}</h1>
            <div>
                Manage your todos -<Link to="/todos">Go here</Link>
            </div>
        </div>
    )
}

function ErrorComponent(){
    return (
        <div className="ErrorComponent">
            <h1>We are working really hard!</h1>
            <div>
                Apologies for the 404.Reach out to our team at ABC-DEF-GHIJ.
            </div>
        </div>
    )
}

function ListTodosComponent(){
    const today = new Date() ;
    const targetDate = new Date(today.getFullYear()+12,today.getMonth(),today.getDate())
    const todos = [
                    {id:1,description:'learn aws', done:false,targetDate:targetDate},
                    {id:2,description:'learn full stack dev',done:false,targetDate:targetDate},
                    {id:3, description:'learn Devops',done:false,targetDate:targetDate},
                  ]
    return (
        <div className="container">
            <h1>Things you want to do</h1>
            <div>
               <table className="table">
                <thead>
                    <tr>
                        <td>Id</td>
                        <td>Description</td>
                        <td>is Done?</td>
                        <td>Target Date</td>
                    </tr>
                </thead>
                <tbody>
                {
                    todos.map(
                        todo => (
                            <tr key={todo.id}>
                            <td>{todo.id}</td>
                            <td>{todo.description}</td>
                            <td>{todo.done.toString()}</td>
                            <td>{todo.targetDate.toDateString()}</td>
                        </tr>
                        )
                    )
                }
                </tbody>
               </table>
            </div>
        </div>
    )
}

function HeaderComponent(){
    return (
        <header className="header">
            <div className="container">
                <div className="row">
                    <nav className="nav navbar-expand-lg">
                    <a className="navbar-brand-ms-2 fs-2 fw-bold text-black" href="http://localhost:3000">aditya</a>
                    <div className="collapse navbar-collpase">
                  <ul className="navbar-nav">
                   

                    <li className="nav-item"><Link className="nav-link" to="/welcome/aditya">Home</Link>
                    </li>
                    <li className="nav-item"><Link className="nav-link" to='/todos'>Todos</Link></li>
                    </ul>
                    </div>
                    <ul className="navbar-nav">
                    <li className="nav-item"><Link className="nav-link" to='/login'>login</Link></li>
                    <li className="nav-item"><Link className="nav-link" to='/logout'>logout</Link></li>
                </ul>
                </nav>
             </div>
             </div>
        </header>
    )
}

function FooterComponent(){
    return (
        <footer className="footer">
            <div className="container">
                Your Footer
            </div>
             {/* <hr/> Footer */}
        </footer>
    )
}

function LogoutComponent(){
    return (
        <div className="LogoutComponent">
             <h1>you are logged out!</h1>
             <div>
                Thank for using our App. Come back soon.
             </div>
        </div>
    )
}
